import { createGlobalStyle } from 'styled-components'
import { StyledButton } from './components/FetchData/Style/FetchData.styled'

export const GlobalStyle = createGlobalStyle` 

* {
  margin: 0;
  padding: 0;
}
html {
  height: 100%;
  width: 100%;
}

body {
  height: 100%;
  width: 100%;
}

StyledLi {
	border-bottom: 2px solid black;
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 1rem 4rem;
}





`
